  false,\n\t\"url\": null,\n\t\"notes\": \"The 2.5-min isostatic gravity data set
  was produced by regridding the 4-km residual isostatic gravity grid of the U.S.
  The isostatic residual gravity grid was developed by the U.S. Geological Survey
  using an Airy Heiskanen model. Local compensation was computed with a depth of 30.0
  km to the root for sites with sea level elevations and a density contrast of 0.35
  g/cm3 across the bottom of the root.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
